INSERT INTO `motivational_phrases` (`id`, `title`, `phrase_fa`, `phrase_en`, `author`, `reg_date`, `user_id`, `sample`) VALUES
(2, 'شکوفایی', 'من در حال رشد و شکوفایی هستم', 'i am growing', NULL, '2021-01-14 09:59:03', 5, 1),
(3, 'جهان هستی', 'من پذیرای تمامی راه هایی هستم  که جهان در پیش رویم میگذارد ', 'I welcome all of the ways the universe wants to bless me.', NULL, '2021-01-14 10:02:35', 5, 1),
(4, 'قدردانی', 'من قدردان تمام کارهای کوچکی هستم که شریک زندگی ام برایم انجام می دهد.', 'I appreciate the small things my partner does for me.', NULL, '2021-01-14 10:07:17', 5, 1),
(5, 'پیشرفت', 'روز به روز من بهتر می شوم و در حال پیشرفت هستم', 'Day by day I am getting better and better', NULL, '2021-01-14 11:31:54', 5, 1),
(6, 'خوشبختی', 'خوشبختی در پایان هیچ راهی نیست. آن تنها می تواند در آغاز راه باشد.', '', 'کوروش سلیمی', '2021-01-14 21:15:15', 5, 1),
(7, 'تغییر', 'اگر از جایت راضی نیستی، جا به جا شو، تو درخت نیستی', '', '', '2021-01-17 16:54:55', 5, 1),
(8, 'blessed', '', 'I am blessed for everything I have', '', '2021-01-17 16:57:43', 5, 1),
(9, 'تلاش', 'من با آرزو کردن و امیدوار بودن به چیزی نرسیده ام . من تنها با کار و تلاش به آن رسیده ام ...', '', '', '2021-01-18 07:19:03', 29, 0),
(11, 'رشد', 'از منطقه ی امن و راحتی خود خارج شوید . شما فقط زمانی میتوانید رشد کنید که مایل باشید سختی بکشید و تلاش کنید تا چیزی جدید را امتحان کنید‌.‌.. ', '', '', '2021-01-18 07:23:39', 29, 0),
(12, 'موفقیت', 'اقدام ، کلید اصلی تمام موفقیت هاست ...', '', '', '2021-01-18 07:25:02', 29, 0),
(13, 'حرکت کردن', 'اگر نمی‌توانید کارهای بزرگ انجام دهید، چیزهای کوچک را با روش عالی انجام دهید .', '', '', '2021-01-18 07:28:06', 29, 0),
(14, 'عشق', 'آن زمان که کسی را دوست دارید عاشق هستید ؛ اما زمانی که رابطه ی خود را با او دوست دارید رفیق هستید‌ .', '', 'کورش سلیمی', '2021-01-18 07:30:36', 29, 0),
(15, 'عشق', 'دوست داشتن یا نداشتن در اختیار ما نیست ، یا رخ می‌دهد یا رخ نمی‌دهد ( عشق یا هست یا نیست ) ولی دوست بودن یک انتخاب است.', '', 'کورش سلیمی', '2021-01-18 07:32:53', 29, 0),
(16, 'موفقیت', 'بزرگترین ریسک، ریسک نکردن است! در این دنیا که به سرعت تغییر می کند، تنها استراتژی که شکست را تضمین می کند، ریسک نکردن است\r\n', 'The biggest risk is not taking risks! In this rapidly changing world, the only strategy that guarantees failure is not to take risks.', 'مارک زاکربرگ', '2021-01-18 08:01:46', 60, 0),
(17, 'رؤیاپردازی', 'شما به خاطر این که پولی ندارید فقیر نیستید بلکه اگر آرزویی نداشته باشید فقیر هستید\r\n', 'You are not poor cause you have no money But if you do not have a dream, you are poor', 'رندی گیج ', '2021-01-18 10:05:35', 60, 0),
(19, 'باور', 'به تمام دلایلی که موفق نمی شوید فکر نکنید… فقط به 1 دلیلی فکر کنید که میدانید موفق می شوید.', 'Do not think about all the reasons you do not succeed, Think only for one reason you know you will succeed.', 'هنر فورد', '2021-01-18 11:22:27', 60, 0),
(20, 'حمایت', 'حامی من کسی است که با وجود او ، خانه ی ما(فضای مشترک میان ما)مکان قابل اطمینان تر و امن تری برای من است.', '', 'کورش سلیمی', '2021-01-19 09:10:34', 29, 0),
(21, 'حمایت ', 'من از تو حمایت میکنم نه از تصمیم های تو ، بنابراین می توانم با تصمیم های تو کاملا مخالف باشم ولی خود تو و وجود تو همیشه تحت حمایت من است. من در هر شرایطی تکیه گاه و پشتیبان تو هستم.', '', 'کورش سلیمی', '2021-01-19 09:15:57', 29, 0),
(22, 'رابطه ', 'رابطه ی خوب رابطه ای است که درک بهتری از خودم به من بدهد.', '', 'کورش سلیمی', '2021-01-19 09:21:48', 29, 0),
(23, 'عشق', 'چرا میگوییم عشق کافی نیست؟ چون عشق با این که میتواند سعادت و بقای رابطه را تضمین کند.اما نمیتواند بقای خودش را تضمین کند. ', '', 'کورش سلیمی', '2021-01-19 09:24:32', 29, 0),
(24, 'دوستی', 'روزی دوست داشتن از دل دوستی جوانه می زند.', '', 'کورش سلیمی', '2021-01-19 09:26:37', 29, 0),
(25, 'موفقیت ', 'اولین شرط توفیق شهامت است و بی باکی.', '', '', '2021-01-19 09:51:00', 29, 0),
(26, 'جهان هستی', 'جهان یک کتاب است و کسانی که سفر نمی کنند فقط یک صفحه از آن را می خوانند.\r\n', 'The world is a book, and those who do not travel read only one page.', 'سنت آگوستین', '2021-01-19 13:23:11', 60, 0),
(27, 'جهان و موفقیت', 'من زندگی خود را صرف ساختن جهانی می کنم که می خواهم در آن زندگی کنم.\r\n', 'I spend my life building the world I want to live in.', 'رابین چیس', '2021-01-19 13:24:19', 60, 0),
(28, 'اثرگذاری', 'شما باید تغییری باشید که می خواهید در جهان مشاهده کنید.\r\n', 'You have been the change, That you want to see in the world.', 'گاندی ', '2021-01-19 13:25:25', 60, 0),
(29, 'هستی', 'دنیا تصویر زنده ای از خداست', '', 'ناشناس', '2021-01-19 13:25:52', 60, 0),
(30, 'تغییر ', 'دنیا از آنچه فکر می کنید شکل پذیرتر است و منتظر است تا آن را شکل دهید.\r\n', 'The world  is more flexible than you think about\r\nAnd it is waiting to shape it.', 'بونو', '2021-01-19 13:27:27', 60, 0),
(31, 'دوستی', 'جوانه ی هر دوست داشتنی در کویر دوست نبودن حتما خشک خواهد شد.', '', 'کوروش سلیمی', '2021-01-19 17:07:42', 5, 0),
(32, 'فردا ', 'ما چیزی در مورد فردا نمیدانیم تمام چیزی که لازمه بدونیم اینه که همدیگر را دوست بداریم ', '', 'چارلی مکسی کتاب پسرک ،موش کور ،روباه واسب ', '2021-01-20 15:38:46', 454, 0),
(33, 'مهربونی ', 'معمولا منتظر مهربونی میمونیم. ...ولی مهربونی باخودمون رو میشه همین الان شروع کنیم', '', 'چارلی مکسی کتاب پسرک ،موش کور ،روباه واسب ', '2021-01-20 21:04:52', 454, 0),
