(468, '', 'ناشنوا باش وقتی همه از محال بودن آرزوهایت سخن میگویند.', '', 'ناشناس ', '2021-03-01 08:21:15', 60, 0),
(469, '', 'ستاره ها بدون تاریکی نمیتوانند بدرخشند.', '', 'ناشناس ', '2021-03-01 08:21:46', 60, 0),
(470, '', 'کسی که تاکنون اشتباهی نکرده است، هیچ چیز جدیدی را امتحان نکرده است.', '', 'انیشتین ', '2021-03-01 08:22:37', 60, 0),
(471, '', 'فردی که اشتباه نکند ارزش کارهای بزرگ را نخواهد داشت', '', 'ادوارد فیلیپس', '2021-03-01 08:23:00', 60, 0),
(472, '', 'اگر آماده اشتباه کردن نباشید هیچ وقت فکر نابی به ذهنتان نخواهد رسید...', '', 'کن رابینسون ', '2021-03-01 08:23:27', 60, 0),
(473, '', 'اگر نمیتوانید پرواز کنید ، بدوید\r\nاگر نمیتوانید بدوید، راه بروید \r\nاگر نمیتوانید راه بروید، سینه خیز بروید\r\nهر کاری که انجام می دهید باید رو به جلو باشید', '', 'مارتین لوترکینگ', '2021-03-01 08:24:00', 60, 0),
(474, '', 'ترس های من، بخشی از ذات من هستند و احتمالا مهمترین قسمت آن خواهند بود', '', 'فرانس کافکا', '2021-03-01 08:24:18', 60, 0),
(475, '', 'مسائلی که به دلیل سطح فعلی تفکر ما به وجود می آیند، نمیتوانند با همان سطح تفکر حل شوند!', '', 'آلبرت انیشتین', '2021-03-01 08:24:44', 60, 0),
(476, '', 'آفتاب به گیاهی می تابد که سر از خاک بیرون آورده باشد...', '', 'لئو تولستوی', '2021-03-01 08:25:02', 60, 0),
(477, '', 'من با هیچ کس جز خودم رقابت نمی کنم؛هدف من مغلوب کردن آخرین کاری است که انجام داده ام', '', 'بیل گیتس ', '2021-03-01 08:25:21', 60, 0),
(478, '', 'بدتر از شکست خوردن در کاری شروع نکردن آن است...', '', 'ست گادین ', '2021-03-01 08:25:40', 60, 0),
(479, 'موفقیت', 'موعقیت خود را نسبت به میزان آرامش ،سلامتی و عشقی که احساس میکنی .بسنج !', '', '', '2021-03-05 03:55:24', 29, 0),
(480, 'موفقیت', 'موفقیت فاصله میان دو شکست است . بدون از دست دادن شور و اشتیاق. ', '', '', '2021-03-05 03:59:46', 29, 0),
(481, 'موفقیت ', 'رمز موفقیت ...دانستن چیزهایی است که دیگران نمی دانند.', '', '', '2021-03-05 04:01:16', 29, 0),
(482, 'رشد', 'فردا متعلق به آنهایی است که امروز ، خود را برای آن مهیا می کنند.', '', '', '2021-03-05 04:02:33', 29, 0),
(483, 'موفقیت', 'برای رسیدن به موفقیت لازم نیست خیلی قوی باشی ، فقط از قوی ترین بهانه ات قوی تر باش.', '', '', '2021-03-05 04:03:52', 29, 0),
(484, 'حرکت کردن', 'چالش ها زندگی را جالب و غلبه بر چالش ها زندگی را معنی دار می کند. ', '', '', '2021-03-05 04:06:04', 29, 0),
(485, 'موفقیت', 'تفاوت بین یک فرد موفق و دیگران ،کمبود قدرت دیگران و فقدان دانش آنها نیست....بلکه کمبود تلاش و اراده شان است. ', '', '', '2021-03-05 04:09:27', 29, 0),
(486, 'موفقیت', 'موانع آن چیزهای ترسناکی هستند که وقتی چشم ها را از هدف می بندید ... می بینید.', '', '', '2021-03-05 04:11:07', 29, 0),
(487, 'تلاش', 'تخیل ....مهم تر از دانش است.', '', '', '2021-03-05 04:11:47', 29, 0),
(488, 'رشد', 'مشتاق ...موفقیت دیگران باشید. ', '', '', '2021-03-05 04:12:28', 29, 0),
(489, '', 'آدمی را آزمودن به کردار باید کرد نه به گفتار؛ چه بیشتر مردم، زشت کردار و نیکو گفتارند.', '', 'فیثاغورث', '2021-03-06 06:00:48', 60, 0),
(490, '', 'تنها یک چراغ است که مرا هدایت می کند و آن چراغ تجربه است.', '', 'پاتریک هنری ', '2021-03-06 06:06:40', 60, 0),
(491, '', 'شما هم می توانید هر کاری را که دوست دارید، بکنید؛ اگر فقط باور کنید که می توانید.', '', 'جک کانفیلد ', '2021-03-06 06:18:52', 60, 0),
(492, '', 'یک دروغ ممکن است دنیا را دور بزند و به جای اولش برگردد؛ اما در همین مدت، یک حقیقت هنوز دارد بند کفش های خود را می بندد تا حرکت کند.', '', 'مارک تواین ', '2021-03-06 06:19:13', 60, 0),
(493, '', 'لحظه ها تنها پرندگان مهاجری هستند که هرگز به آشیانه باز نخواهند گشت\r\n', '', 'ناشناس ', '2021-03-06 06:20:53', 60, 0),
(494, 'موفقيت', 'حوصله هاي كوچك براي آرزوهاي بزرگ ماست.', '', '', '2021-04-15 03:17:10', 60, 0),
(495, '', 'تنها راهزنی که دار و ندار آدمی را به تاراج می برد\r\nاندیشه های منفی خود او است', '', 'كنفسيوس', '2021-04-15 03:18:07', 60, 0),
(496, '', 'آدمی را آزمودن به کردار باید کرد نه به گفتار؛ چه بیشتر مردم، زشت کردار و نیکو گفتارند.\r\n', '', 'فيثاغورث', '2021-04-15 03:20:58', 60, 0),
(497, '', 'تنها یک چراغ است که مرا هدایت می کند و آن چراغ تجربه است.', '', 'پاتريك هنري ', '2021-04-15 03:21:47', 60, 0),
(498, '', 'هر كس كه بداند كه نداند از همه آگاه تر است ', '', 'سقراط', '2021-04-15 03:24:17', 60, 0),
(499, '', 'رويدادهاي بد احتمالاً رخ خواهد داد ولي هرگز احتمال ندارد به اندازه اي كه ميترسيم باشند.', '', '', '2021-04-15 03:26:24', 60, 0),
(500, '', 'در ملال، زمان فتح نشده است بلكه زندانبان ماست.\r\n', '', 'لارس اسوندسن', '2021-04-15 03:33:41', 60, 0);
